CREATE DEFINER=`root`@`localhost` PROCEDURE `getBooks` ()   begin
	select 
		b.name as bookName,
		b.author as author,
		b.price as price,
		b.rating as rating,
		b.description as description,
		b.bookId as bookId ,
		b.coverImg as bookCover,
		c.name as categoryName,
		c.categoryId as categoryId,
		p.publisherId as publisherId,
		p.name as publisherName
	from books b
		inner join category c on c.categoryId = b.categoryId
		inner join publisher p on p.publisherId = b.publisherId 
	where b.isDeleted = false;
END$$

