CREATE DEFINER=`root`@`localhost` PROCEDURE `getComments` (IN `inBookId` INT(11))   begin
	select 
		c.comment as comment, 
		c.`date` as commentDate,
		concat(u.firstName, " ", u.lastName) as userName,
		c.commentId as commentId
	from 
		comments c
	inner join users u on u.userId = c.userId
	where c.bookId = inBookId;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `getFeedbacks` ()   begin
